import createReactComponent from "../createReactComponent";
import defaultAttributes from "../defaultAttributes";
var Disc = createReactComponent("Disc", ["svg", defaultAttributes, [["circle", {
  cx: "12",
  cy: "12",
  r: "10",
  key: "14id60"
}], ["circle", {
  cx: "12",
  cy: "12",
  r: "3",
  key: "n6u7h6"
}]]]);
export default Disc;
